import React from "react";
import Header from "../../components/Header";
import Footer from "../../components/Footer";
import { YMaps, Map } from 'react-yandex-maps';
import s from "./Contacts.module.scss"
function Contacts(){
    const myGeoObject = {
        geometry: {
          type: 'Point',
          coordinates: [43.238332, 76.923358],
        },
        properties: {
          balloonContent: 'My Custom Geo Object',
        },
      };

    return(
        <>
        <Header />
        <h2>Location:</h2>
        <YMaps>
      <div>
        <Map
          defaultState={{ center: [43.238332, 76.923358], zoom: 17 }}
          style={{ width: '50%', height: '400px', margin: "0 auto" }}
        />
          <Placemark geometry={myGeoObject.geometry} properties={myGeoObject.properties} />
      </div>
    </YMaps>

        <Footer/>
        </>
    )
}
export default Contacts;
